import React, { useState, useEffect } from 'react';
import { Table, Button, Modal, Form, Dropdown } from 'react-bootstrap';
import Header from "./Header";
import axios from 'axios';

const Database = () => {
  const [tables, setTables] = useState([]);
  const [selectedTable, setSelectedTable] = useState('');
  const [records, setRecords] = useState([]);

  // Fetch tables from the database on component mount
  useEffect(() => {
    const fetchTables = async () => {
      try {
        const response = await axios.get('/api/tables');
        setTables(response.data);
      } catch (error) {
        console.error('Error fetching tables:', error);
      }
    };

    fetchTables();
  }, []);

  // Fetch records for the selected table
  useEffect(() => {
    const fetchRecords = async () => {
      if (selectedTable) {
        try {
          const response = await axios.get(`/api/tables/${selectedTable}/records`);
          setRecords(response.data);
        } catch (error) {
          console.error(`Error fetching records for ${selectedTable}:`, error);
        }
      }
    };

    fetchRecords();
  }, [selectedTable]);

  const handleTableSelect = (tableName) => {
    setSelectedTable(tableName);
  };

  return (
    <div className="container">
        <Header />
      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          Select Table
        </Dropdown.Toggle>
        <Dropdown.Menu>
          {tables.map((table, index) => (
            <Dropdown.Item key={index} onClick={() => handleTableSelect(table)}>
              {table}
            </Dropdown.Item>
          ))}
        </Dropdown.Menu>
      </Dropdown>

      <div className="crud-operations">
      </div>

      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Message</th>
            <th>Company</th>
            <th>Location</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {records.map((record, index) => (
            <tr key={index}>
              <td>{record.id}</td>
              <td>{record.name}</td>
              <td>{record.email}</td>
              <td>{record.phone}</td>
              <td>{record.message}</td>
              <td>{record.company}</td>
              <td>{record.location}</td>
              <td>
                <Button variant="primary">Edit</Button>{' '}
                <Button variant="danger">Delete</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      <Modal>
        <Form>

          <Button variant="primary">Submit</Button>
        </Form>
      </Modal>
    </div>
  );
};

export default Database;
